import React from 'react';
import '../stylesheets/aboutMe.scss';


const Landing = () => {
  const openKey = "{";
  const closeKey = "}";
  return (
  <div class="container">
      <pre><code class="language-java hljs ">
        <span class="hljs-keyword">public</span>
        <span class="hljs-class"><span class="hljs-keyword">class</span> <span class="hljs-title">Welcome</span> {openKey}</span>
        <span class="hljs-keyword">public</span> <span class="hljs-keyword">static</span> <span class="hljs-keyword">void</span> <span class="hljs-title">main</span>(String[] args) {openKey}
        System.out.println(<span class="hljs-string">"Pulsa el bot√≥n ejecutar"</span>)
        {closeKey}
      {}}
      </code>
    </pre>
  </div>
  );
}

export default Landing;
